import React from "react";
import "./login.css";

export const AccountBox = () => {
  return (
    <div className="BoxContainer">
      <div className="TopContainer">
        <div className="BackDrop">
          <div className="Header">
            <h2>Login</h2>
          </div>
        </div>
      </div>
    </div>
  );
};
